import React from "react";
import Form from "./Form";

var userIsRegistered = false;

function Register(){
  if(userIsRegistered === true){
    return (<Form 
      type="text"
      placeholder="Username"
    />);
  }
}

function App() {
  return (
    <div className="container">
    {Register()}
    </div>
  );
}

export default App;
